static void stateTrans2(uint8_t in[], uint64_t out[]){
    int i=0, j=0;
    int k=7;
    uint64_t a;
    out[0] = 0;
    out[1] = 0;
    out[2] = 0;
    while (j < 15){
        a = in[j++];
        k = 7;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=7
        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=6
        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=5
        i++;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=4
        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=3
        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=2
        i++;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=1
        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=0
        k = 7;
        a = in[j++];

        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=7
        i++;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=6
        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=5
        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=4
        i++;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=3
        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=2
        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=1
        i++;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=0
        a = in[j++];
        k = 7;

        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=7
        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=6
        i++;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=5
        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=4
        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=3
        i++;
        out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=2
        out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=1
        out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=0
        i++;
    }

    a = in[j++];
    k = 7;
    
    out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=7
    out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=6
    out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=5
    i++;
    out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=4
    out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=3
    out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=2
    i++;
    out[0] = out[0] ^ (((a >> k--) & 0x01) << i);//k=1
    out[1] = out[1] ^ (((a >> k--) & 0x01) << i);//k=0
    k = 7;
    a = in[j++];

    out[2] = out[2] ^ (((a >> k--) & 0x01) << i);//k=7
    
}

