static void matrix_mulBitslice(
    uint64_t *output,
    uint64_t *rIn,
    const uint64_t* matrix)
{
    uint64_t a,b,c;
    uint64_t temp0 = 0;
    uint64_t temp1 = 0;
    uint64_t temp2 = 0;

    int d=0,f;

    a = rIn[0];
    b = rIn[1];
    c = rIn[2];

    output[0] = 0;
    output[1] = 0;
    output[2] = 0;

    f = 0;
    for(int i=0;i<129;i+=3){
        
        temp0  = (matrix[f + 0] & a);
        temp1  = (matrix[f + 3] & a);
        temp2  = (matrix[f + 6] & a);
        
        temp0 ^= (matrix[f + 1] & b);
        temp1 ^= (matrix[f + 4] & b);
        temp2 ^= (matrix[f + 7] & b);

        temp0 ^= (matrix[f + 2] & c);
        temp1 ^= (matrix[f + 5] & c);
        temp2 ^= (matrix[f + 8] & c);
        
        temp0 = (_popcnt64(temp0)&0x01);
        temp1 = (_popcnt64(temp1)&0x01);
        temp2 = (_popcnt64(temp2)&0x01);
        
        output[0] = output[0] ^ (temp0 << d);
        output[1] = output[1] ^ (temp1 << d);
        output[2] = output[2] ^ (temp2 << d);
        d++;
        f += 9;
    }
}



static void substitution(uint64_t *r) {
    uint64_t a,b,c;

        c = r[0];
        b = r[1];
        a = r[2];
        r[2] = a ^ (b&c);
        r[1] = (a^b) ^ (a&c);
        r[0] = (a^b) ^ ((a&b) ^ c); 
}

void LowMCEnc(uint64_t *in, uint64_t *out, uint64_t *key)
{
    uint64_t rRoundKey[3] = {0};

    if (in != out) {
        out[0] =in[0];
        out[1] =in[1];
        out[2] =in[2];
    }
    
    matrix_mulBitslice(rRoundKey, key, keyMatrices_L1);  
    
    out[0] = out[0] ^ rRoundKey[0];
    out[1] = out[1] ^ rRoundKey[1];
    out[2] = out[2] ^ rRoundKey[2];

    for (uint32_t r = 1; r <= ROUNDS; r++) {
        matrix_mulBitslice(rRoundKey, key, keyMatrices_L1 + (r*387));
        substitution(out);            
        matrix_mulBitslice(out, out, (linearMatrices_L1 + ((r-1)*387)));    

        out[0] = out[0] ^ roundConstant_L1[(r-1)*3 + 0] ^ rRoundKey[0];
        out[1] = out[1] ^ roundConstant_L1[(r-1)*3 + 1] ^ rRoundKey[1];
        out[2] = out[2] ^ roundConstant_L1[(r-1)*3 + 2] ^ rRoundKey[2];
    }
}


